import React from "react";
import * as ReactDOMClient from "react-dom/client";
import ReactDOM from "react-dom";
import App from "./app";
import "./css/main.css";

const app = ReactDOMClient.createRoot(document.getElementById("main"));
app.render(<App />);

class User extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      users: ["Jack", "Max", "Leo", "Alex"],
      ind: 0,
    };
  }
  render() {
    return (
      <div>
        <ul>
          {this.props.users((el) => (
            <div>
              {this.props.ind}:{el}
            </div>
          ))}
        </ul>
      </div>
    );
  }
}
export default User;

const link = document.getElementByIdById("test");
ReactDOM.render(<User />, link);
